PROBLEM: 'A wire is cut into two pieces, one of length '$a$' and the other of length '$b$'. The piece of length '$a$' is bent to form an equilateral triangle, and the piece of length '$b$' is bent to form a regular hexagon. The triangle and the hexagon have equal area. What is '$\frac{a}{b}$'?\n'
=======
CHOICES:
[A]: 1
[B]: \frac{\sqrt{6}}{2}
[C]: \sqrt{3}
[D]: 2
[E]: \frac{3\sqrt{2}}{2}

PROBLEM: 'The real numbers '$c,b,a$' form an arithmetic sequence with '$a \geq b \geq c \geq 0$'. The quadratic '$ax^2+bx+c$' has exactly one root. What is this root?\n'
=======
CHOICES:
[A]: -7-4\sqrt{3}
[B]: -2-\sqrt{3}
[C]: -1
[D]: -2+\sqrt{3}
[E]: -7+4\sqrt{3}
